import React from 'react';
import Task from './components/Task';
import TaskList from './components/TaskList';

function App() {
  return (
    <div className="App">
      <TaskList/>
      <Task name="write program"/>
      <Task name="edit bug"/>
      <Task name="test program"/>
    </div>
  );
}

export default App;
